const Note = ({ note, toggleImportance }) => {
    const label = note.important
      ? 'make not important' : 'make important'

    return (
      <li className="note">
        {note.content} 
        <button style={{marginLeft: 10}} onClick={() =>toggleImportance(note.id)}>{label}</button>
      </li>
    )
  }

